import './App.css';
import Login from './component/Login'
import SignUp from './component/SignUp';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect,
} from "react-router-dom";

function App() {
  return (
   <div>
    <Router>

        {/* <Login /> */}
        <Route exact path="/signup" component={SignUp} />
        <Route exact path="/login" component={Login} />

    </Router>
   </div>
  );
}

export default App;
